import { Card, Button } from 'react-bootstrap';

export default function Produto(props) {
    return (
        <Card className={props.categoria} border="dark" style={{ width: '18rem' }}>
            <Card.Img variant="top"  alt ="Imagem do produto" />
            <Card.Body>
                <Card.Title className="nome-produto">{props.nome}</Card.Title>
                <Card.Text ClassName="preco-antigo">{props.preco}</Card.Text>
                <Card.Text ClassName="preco-novo">{props.precoVenda}</Card.Text>
                <Button variant="success" className = "mx-auto">Saber mais</Button>
            </Card.Body>
        </Card>
    )
}
